import React from 'react';

const Table = ( {data} ) => {
    const tableRows = data.rows;
    const tableColumns = data.columns;

    return(
        <tbody>
          {tableRows.map((rows, index) =>
            <tr key={index}>
              {tableColumns.map((columns, item) =>
                <td key={item}>{columns.title}</td>
              )}
            </tr>
          )}
        </tbody>
      )
};

export default Table;
